import { useState } from "react";

import './App';
import './Square.css';

function Square(props) {

    const[color, setColor] = useState(props.square);

    function clickedOn() {
        if (color === 'box-white') {
            setColor('box-black');
            props.onClick(props.num + 1);
        } else {
            setColor('box-white');
        }
    }

    return (
        <div className={color} onClick={clickedOn}>

        </div>
    )


}

export default Square;
